const userUpdate = (id, name, lastName, secondName, ci, gender, city) => {
  var requestOptions = {
    method: "PUT",
    redirect: "follow",
  };

  fetch(
    "https://9nlr2dh5oh.execute-api.us-east-2.amazonaws.com/default/aws-update?id=" +
    id +
      "?nombre=" +
      name +
      "?apellido_paterno=" +
      lastName +
      "?apellido_materno=" +
      secondName +
      "?ci=" +
      ci +
      "?genero=" +
      gender +
      "?direccion=" +
      city +
      "",
    requestOptions
  )
    .then((response) => response.text())
    .then((result) => console.log(result))
    .catch((error) => console.log("error", error));
};
export default userUpdate;
